create table #to_update (generic_form_rxcui varchar(30), brand_form_rxcui varchar(30))
-- delete from #to_update









-- from rxnconso_full


UPDATE f
SET generic_form_rxcui = u.generic_form_rxcui
FROM #to_update u
JOIN c_Drug_Formulation f ON f.form_rxcui = brand_form_rxcui
-- (8084 row(s) affected)

UPDATE f
SET generic_form_rxcui = u.generic_rxcui
-- select *
FROM c_Drug_Generic_Related u
JOIN c_Drug_Formulation f ON substring(f.form_rxcui,4,20) = u.source_id
where f.form_rxcui like 'KEB%'
and form_rxcui = 'KEB11057'


UPDATE f
SET generic_form_rxcui = f2.form_rxcui
-- select substring(Corresponding_RXCUI,5,20)
FROM Kenya_Drugs u
JOIN c_Drug_Formulation f ON substring(f.form_rxcui,4,20) = u.Retention_No
JOIN c_Drug_Formulation f2 ON f2.form_rxcui = substring(Corresponding_RXCUI,5,20)
where f.form_rxcui like 'KEB%'
and f.generic_form_rxcui IS NULL
-- (1090 row(s) affected)

UPDATE f
SET generic_form_rxcui = replace(form_rxcui,'KEB','KEG')
-- select count(*)
FROM c_Drug_Formulation f
where f.form_rxcui like 'KEB%'
and exists (select 1 from c_Drug_Formulation f2
	where f2.form_rxcui = replace(f.form_rxcui,'KEB','KEG'))
and f.generic_form_rxcui IS NULL
-- (920 row(s) affected)

UPDATE f
SET generic_form_rxcui = f2.form_rxcui
-- select f.form_rxcui, SCD_PSN_VERSION, f2.form_rxcui
FROM Kenya_Drugs u
JOIN c_Drug_Formulation f ON substring(f.form_rxcui,4,20) = u.Retention_No
JOIN c_Drug_Formulation f2 ON f2.form_descr = SCD_PSN_VERSION 
where f.form_rxcui like 'KEB%'
and f.generic_form_rxcui IS NULL
-- (111 row(s) affected)

